import lzma
import base64
import json
import re

text = lzma.decompress(base64.b85decode(compressed)).decode()
text = re.sub('([A-ZÄÖÜa-zäöüß_])', r'"\1"', text)
trie = json.loads(text)

END = '_'

german_words = []
def travel_trie(trie, word):
  if trie == END:
    german_words.append(word[:-1])
    return

  for letter, sub_trie in trie.items():
    travel_trie(sub_trie, word+letter)

